import React, { useEffect, useState } from 'react';
import { API_BASE_URL } from '../apiConfig';

interface Person {
  ID_pers: number;
  name: string;
  firstname: string;
}

interface Subject {
  ID_subject: number;
  subject: string;
}

const Insert: React.FC = () => {
  const [persons, setPersons] = useState<Person[]>([]);
  const [subjects, setSubjects] = useState<Subject[]>([]);
  const [selectedPerson, setSelectedPerson] = useState<string>('');
  const [selectedSubject, setSelectedSubject] = useState<string>('');
  const [selectedMonth, setSelectedMonth] = useState<string>('');
  const [loading, setLoading] = useState(true);
  const [error, setError] = useState<string | null>(null);

  useEffect(() => {
    // Fetch persons from the API
    fetch(`${API_BASE_URL}/api/persons`)
      .then((response) => {
        if (!response.ok) {
          throw new Error('Network response was not ok');
        }
        return response.json();
      })
      .then((data) => {
        setPersons(data);
      })
      .catch((error) => {
        setError(error.message);
      });

    // Fetch subjects from the API
    fetch(`${API_BASE_URL}/api/subjects`)
      .then((response) => {
        if (!response.ok) {
          throw new Error('Network response was not ok');
        }
        return response.json();
      })
      .then((data) => {
        setSubjects(data);
        setLoading(false);
      })
      .catch((error) => {
        setError(error.message);
        setLoading(false);
      });
  }, []);

  const generateMonthOptions = () => {
    const options = [];
    for (let year = 2022; year <= 2028; year++) {
      for (let month = 1; month <= 12; month++) {
        const monthStr = month.toString().padStart(2, '0');
        options.push(`${monthStr}/${year}`);
      }
    }
    return options;
  };

  const handleSubmit = (event: React.FormEvent) => {
    event.preventDefault();
    // Find the selected person and subject
    const selectedPersonObj = persons.find(
      (person) => `${person.name} ${person.firstname}` === selectedPerson
    );
    const selectedSubjectObj = subjects.find(
      (subject) => subject.subject === selectedSubject
    );

    if (selectedPersonObj && selectedSubjectObj) {
      // Format the month as 01/mm/yyyy
      const [month, year] = selectedMonth.split('/');
      const formattedMonth = `${month.padStart(2, '0')}/${year}`;

      // Print the required information
      console.log('ID_pers:', selectedPersonObj.ID_pers);
      console.log('ID_subject:', selectedSubjectObj.ID_subject);
      console.log('month:', formattedMonth);
    } else {
      console.log('Error: Selected person or subject not found');
    }
  };

  if (loading) {
    return <div>Loading...</div>;
  }

  if (error) {
    return <div>Error: {error}</div>;
  }

  return (
    <div>
      <h2>Insert Component</h2>
      <form onSubmit={handleSubmit}>
        <div>
          <label htmlFor="person">Select Person:</label>
          <select
            id="person"
            value={selectedPerson}
            onChange={(e) => setSelectedPerson(e.target.value)}
            required
          >
            <option value="">--Please choose a person--</option>
            {persons.map((person) => (
              <option key={person.ID_pers} value={person.name}>
                {person.name} {person.firstname}
              </option>
            ))}
          </select>
        </div>
        <div>
          <label htmlFor="subject">Select Subject:</label>
          <select
            id="subject"
            value={selectedSubject}
            onChange={(e) => setSelectedSubject(e.target.value)}
            required
          >
            <option value="">--Please choose a subject--</option>
            {subjects.map((subject) => (
              <option key={subject.ID_subject} value={subject.subject}>
                {subject.subject}
              </option>
            ))}
          </select>
        </div>
        <div>
          <label htmlFor="month">Select Month:</label>
          <select
            id="month"
            value={selectedMonth}
            onChange={(e) => setSelectedMonth(e.target.value)}
            required
          >
            <option value="">--Please choose a month--</option>
            {generateMonthOptions().map((month) => (
              <option key={month} value={month}>
                {month}
              </option>
            ))}
          </select>
        </div>
        <button type="submit">Submit</button>
      </form>
    </div>
  );
};

export default Insert;
